import React, { useState } from "react";
import logo from "../assets/portfolio-pilot-logo.png"; // adjust this path as needed

export default function Signup() {
  const [form, setForm] = useState({
    fullName: "",
    email: "",
    password: "",
    role: "Tenant",
    agree: false,
  });

  const [strength, setStrength] = useState("Too Weak");

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    const val = type === "checkbox" ? checked : value;

    setForm((prev) => ({ ...prev, [name]: val }));

    if (name === "password") {
      if (value.length > 8) setStrength("Strong");
      else if (value.length > 4) setStrength("Medium");
      else setStrength("Too Weak");
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!form.agree) {
      alert("You must agree to the Terms of Service and Privacy Policy.");
      return;
    }
    console.log("Submitted:", form);
    // send to backend here
  };

  return (
    <div style={styles.page}>
      <img src={logo} alt="Portfolio Pilot" style={styles.logo} />

      <form style={styles.form} onSubmit={handleSubmit}>
        <h2 style={styles.heading}>Sign Up</h2>

        <input
          style={styles.input}
          type="text"
          placeholder="Full Name"
          name="fullName"
          value={form.fullName}
          onChange={handleChange}
          required
        />
        <input
          style={styles.input}
          type="email"
          placeholder="Email"
          name="email"
          value={form.email}
          onChange={handleChange}
          required
        />
        <input
          style={styles.input}
          type="password"
          placeholder="Password"
          name="password"
          value={form.password}
          onChange={handleChange}
          required
        />
        <p style={styles.strength}>Strength: <span>{strength}</span></p>

        <select
          style={styles.select}
          name="role"
          value={form.role}
          onChange={handleChange}
        >
          <option value="Tenant">Tenant</option>
          <option value="Landlord">Landlord</option>
        </select>

        <div style={styles.checkboxWrap}>
          <input
            type="checkbox"
            name="agree"
            checked={form.agree}
            onChange={handleChange}
          />
          <label style={styles.checkboxLabel}>
            I agree to the Terms of Service and Privacy Policy
          </label>
        </div>

        <button type="submit" style={styles.button}>Sign Up</button>
      </form>
    </div>
  );
}

const styles = {
  page: {
    backgroundColor: "#0c0c0c",
    color: "#fff",
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    padding: "20px",
  },
  logo: {
    width: "200px",
    marginBottom: "30px",
  },
  form: {
    backgroundColor: "#1a1a1a",
    padding: "30px",
    borderRadius: "10px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.5)",
    width: "100%",
    maxWidth: "360px",
    display: "flex",
    flexDirection: "column",
  },
  heading: {
    marginBottom: "20px",
    color: "#e63946",
    textAlign: "center",
  },
  input: {
    marginBottom: "15px",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #444",
    backgroundColor: "#111",
    color: "#fff",
  },
  select: {
    marginBottom: "15px",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #444",
    backgroundColor: "#111",
    color: "#fff",
  },
  strength: {
    fontSize: "14px",
    marginBottom: "10px",
  },
  checkboxWrap: {
    display: "flex",
    alignItems: "center",
    marginBottom: "15px",
  },
  checkboxLabel: {
    marginLeft: "8px",
    fontSize: "14px",
  },
  button: {
    padding: "12px",
    backgroundColor: "#e63946",
    color: "#fff",
    border: "none",
    borderRadius: "5px",
    fontWeight: "bold",
    cursor: "pointer",
  },
};
